import React from 'react'
import usePath from '../../hooks/usePath';

const style = {
    color: "blue",
    padding: "10px",
    margin: "100px auto",
    textAlign: "center",
    width: "100%"
};

const Manage = () => {

    usePath(window.location.pathname);
    return (
        <h1 style={style}>WELCOME TO MANAGE PAGE</h1>
    )
}

export default Manage;
